import React, { useState, useRef } from "react";

const LiquidGlassCard = ({ children, className = "", hover = true, ...props }) => {
  const [mousePosition, setMousePosition] = useState({ x: 0, y: 0 });
  const [isHovered, setIsHovered] = useState(false);
  const cardRef = useRef(null);

  const handleMouseMove = (e) => {
    if (!cardRef.current) return;
    
    const rect = cardRef.current.getBoundingClientRect();
    const x = e.clientX - rect.left;
    const y = e.clientY - rect.top;
    
    setMousePosition({ x, y });
    console.log('Mouse position:', x, y); // Debug log
  };

  const handleMouseEnter = () => {
    setIsHovered(true);
    console.log('Mouse entered'); // Debug log
  };

  const handleMouseLeave = () => {
    setIsHovered(false);
    setMousePosition({ x: 0, y: 0 });
    console.log('Mouse left'); // Debug log
  };

  // Calculate rotation - make it very obvious
  const rotateX = isHovered ? (mousePosition.y - 150) / 5 : 0;
  const rotateY = isHovered ? (mousePosition.x - 200) / 5 : 0;

  return (
    <div
      ref={cardRef}
      className={`relative group overflow-hidden rounded-3xl backdrop-blur-xl border shadow-2xl shadow-black/10 
        transition-all duration-300 ease-out ${className}`}
      onMouseMove={handleMouseMove}
      onMouseEnter={handleMouseEnter}
      onMouseLeave={handleMouseLeave}
      style={{
        transform: `perspective(1000px) rotateX(${rotateX}deg) rotateY(${rotateY}deg)`,
        background: isHovered 
          ? `radial-gradient(circle at ${mousePosition.x}px ${mousePosition.y}px, rgba(255, 0, 0, 0.5) 0%, rgba(0, 255, 0, 0.3) 50%, rgba(0, 0, 255, 0.1) 100%)`
          : 'rgba(255, 255, 255, 0.1)',
        borderColor: isHovered ? 'rgba(255, 255, 255, 0.5)' : 'rgba(255, 255, 255, 0.2)',
      }}
      {...props}
    >
      {/* Very obvious highlight */}
      <div
        className="absolute inset-0 transition-opacity duration-200"
        style={{
          opacity: isHovered ? 1 : 0,
          background: `radial-gradient(circle at ${mousePosition.x}px ${mousePosition.y}px, rgba(255, 255, 0, 0.8) 0%, transparent 50%)`,
        }}
      />
      
      {/* Very obvious shimmer */}
      <div
        className="absolute inset-0 transition-all duration-500"
        style={{
          opacity: isHovered ? 1 : 0,
          background: `linear-gradient(45deg, transparent 30%, rgba(255, 255, 255, 0.9) 50%, transparent 70%)`,
          transform: `translateX(${isHovered ? mousePosition.x - 200 : -200}px) translateY(${isHovered ? mousePosition.y - 100 : -100}px) rotate(45deg)`,
        }}
      />
      
      {/* Debug info */}
      {isHovered && (
        <div className="absolute top-2 left-2 bg-black/50 text-white text-xs p-2 rounded z-50">
          Mouse: {Math.round(mousePosition.x)}, {Math.round(mousePosition.y)}<br/>
          Rotate: {Math.round(rotateX)}, {Math.round(rotateY)}
        </div>
      )}
      
      <div className="relative z-10">
        {children}
      </div>
    </div>
  );
};

const LiquidGlassCardHeader = ({ children, className = "", ...props }) => (
  <div className={`flex flex-col space-y-1.5 p-6 ${className}`} {...props}>
    {children}
  </div>
);

const LiquidGlassCardTitle = ({ children, className = "", ...props }) => (
  <h3 className={`text-2xl font-semibold leading-none tracking-tight ${className}`} {...props}>
    {children}
  </h3>
);

const LiquidGlassCardDescription = ({ children, className = "", ...props }) => (
  <p className={`text-sm text-muted-foreground ${className}`} {...props}>
    {children}
  </p>
);

const LiquidGlassCardContent = ({ children, className = "", ...props }) => (
  <div className={`p-6 pt-0 ${className}`} {...props}>
    {children}
  </div>
);

const LiquidGlassCardFooter = ({ children, className = "", ...props }) => (
  <div className={`flex items-center p-6 pt-0 ${className}`} {...props}>
    {children}
  </div>
);

export { 
  LiquidGlassCard, 
  LiquidGlassCardHeader, 
  LiquidGlassCardFooter, 
  LiquidGlassCardTitle, 
  LiquidGlassCardDescription, 
  LiquidGlassCardContent 
};
